import { useState, useEffect } from "react";
// import logo from "./logo.svg";
import "./App.css";

const App = () => {
  const [placeholder, setPlaceholder] = useState("Hi");

  useEffect(() => {
    fetch("/hello")
      .then((res) => res.json())
      .then((data) => {
        setPlaceholder(data.result);
      });
  }, []);

  return (
    <div className="App">
      <p>Flask says {placeholder}</p>
    </div>
  );
};

export default App;
